import{BrowserRouter, Route, Routes} from 'react-router-dom';
import './App.css';
import Menu from './components/Menu';
import Home from './components/Home';
import Aboutus from './components/Aboutus';
import Accommodation from './components/Accommodation';
import MenuC from './components/MenuC';
import TourTravel from './components/TourTravel';
import News from './components/News';
import Service from './components/Service';
import Gallery from './components/Gallery';
import Contact from './components/Contact';
import UpdateUser from './components/UpdateContact';
import ListUser from './components/ListContact';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Menu/>
      <Routes>
        <Route path='/' element={<Home/>}></Route>
        <Route path='/aboutus' element={<Aboutus/>}></Route>
        <Route path='/accommodation' element={<Accommodation/>}></Route>
        <Route path='/menu' element={<MenuC/>}></Route>
        <Route path='/tourtravel' element={<TourTravel/>}></Route>
        <Route path='/service' element={<Service/>}></Route>
        <Route path='/news' element={<News/>}></Route>
        <Route path='/gallery' element={<Gallery/>}></Route>
        <Route path='/contact' element={<Contact/>}>
        <Route path='program' element={<Program/>}/>
          <Route path='/update-contact' element={<UpdateUser/>}/>
          <Route path='/list-user' element={<ListUser/>}/>
        </Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
